import { FETCH_ALL, CREATE, UPDATE} from '../constants/actionTypes';

const reducer =  (state, action) => {
  switch (action.type) {
    case FETCH_ALL:
      return state;
    case CREATE:
      return state;
    default:
      break;
  }
};
